import './css/style.css';



<div className='font'>
<div className='container'>
      <div className='text flexCenter'>
            لديك 5 مواعيد اليوم
      </div>
</div>
</div>

const App = () => {
      return (
              <Container fluid="md">
              <Row>
                <Col>1 of 1</Col>
              </Row>
            </Container>
      )
}


export default App
